import React from "react";
import { FilterButtons, RangeButtons } from "../Buttons/Buttons";
// import "./Filter.css";

const Filter: React.FC = () => {
  return (
    <>
      <div>
        <FilterButtons name="All" />
        <FilterButtons name="New" />
        <FilterButtons name="Most Popular" />
        <FilterButtons name="Open Now" />
        <FilterButtons name="Map View" />
      </div>
      <div>
        <RangeButtons name="Price Range" />
        <RangeButtons name="Price Range" />
        <RangeButtons name="Price Range" />
      </div>
    </>
  );
};

export default Filter;
